import React, { Component } from 'react'
import ReactDOM from 'react-dom';
// import logo from './logo.svg';
// import './App.css';

export default class App extends Component {
  render() {
    return (
      <div>
        <h1 className="bg-success text-white text-center p-2">
          Kelly McNutt Sucks
        </h1>
          <p>
          Babel is used to turn ES6-->ES5 code for useability on non-compatible devices
          </p>
      </div>
    );
  }
}
class ProductList extends React.Component {
  render() {
    return (
      <div className='ui unstackable items'>
        Sup Biatch, I am a basic React Component also.
        <Product />
      </div>
    );
  }
}
class Product extends React.Component {
  render() {
    return (
      <div className='item'>
        <div className='image'>
          <img src='./image-aqua.jpg' alt="prod" />
        </div>
        <div className='middle aligned content'>
          <div className='description'>
            <a>Fort Knight </a>
            <p> Authentic renaissance actors, delivered in just two weeks</p>
          </div>
          <div className='extra'>
            <span>Submitted by:</span>
             <div>
             <img
              className='ui avatar image'
              src={require('./daniel.jpg' )}
              />
            </div>
          </div>
        </div>
      </div>
    );
  }
}

ReactDOM.render(
  <ProductList />,document.getElementById('content')
);
